import React from 'react'
import Product from './Product';

const products = [
    {
        id:1,
        name:'Lemon',
        price:45,
        category:'vegtables'
    },
    {
        id:2,
        name:'Apple',
        price:35,
        category:'fruits'
    },
]

const Products = () => {
  return (
    <div>
        <h2>products</h2>
        <div>
            {
                products.map(product => <Product product={product} />)
            }
        </div>
    </div>
  )
}

export default Products;
